import styled from "styled-components"

type LayoutProps = {
  children: React.ReactNode
}

const StyledLayout = styled.div`
  margin: 20px auto;
  padding: 20px 0;
  width: 800px;
`

const Layout = (props: LayoutProps) =>
  <StyledLayout>{props.children}</StyledLayout>

export default Layout
